<p>Sie haben das Recht, die Einschraenkung der Verarbeitung Ihrer personenbezogenen Daten zu verlangen. Hierzu koennen Sie sich jederzeit an uns wenden. Das Recht auf Einschraenkung der Verarbeitung besteht in folgenden Faellen:</p>
